    [],nt"revision_timestamp": "2016-07-27T23:05:31.357727",nt"name": "mosquito-and-west-nile-virus-monitoring-program",nt"isopen":
    false,nt"url": null,nt"notes": "In 2004, in cooperation with USGS in Fort
    Collins, a monitoring study was established to assess the level of occurrence and
    potential effects of WNV on wild raptor populations at RMA using the American kestrel
     as a surrogate sentinel species.  Annual inception and the level of WNV occurrence
    will be monitored as well as kestrel survival and reproduction parameters between
    infected and non-infected individuals within the population. The results of this
    study will provide insights as to how WNV may be impacting Kestrels as well as other
    populations of raptors in the wild. Results for this study are still pending.",nt"license_title":
